import React from 'react';
import DeltaNavbar from './Navbar';
import Footer from './Footer';
import ThankYou from './ThankYou';

function ThankYouPage() {
  return (
    <React.Fragment>
      <DeltaNavbar />
      <ThankYou />
      <Footer />
    </React.Fragment>
  );
}

export default ThankYouPage;
